import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'AngularSNAP!';
}
<div class="navBar">
  <!-- image should be a link to home page -->
  <div class="Logo">
    <img src="../assets/Thanos_Snap.png" alt="Thanos Snapping Emote" />
    <h2>AngularSNAP!</h2>
  </div>

  <button class="Link">Deck Builder Link</button>
  <button class="Link">Card Rater Link</button>
  <button>GitHub Button</button>
  <button>L/D Mode Button</button>
</div>

<div class="contentDiv">
  <h1>Welcome!</h1>
</div>
